  def super_category_change(self, **event_args):
    selected_super_category = self.super_category.selected_value
    if selected_super_category in Super_to_product:
      self.product_name.items = Super_to_product[selected_super_category]
    if selected_super_category in sup_to_sub:
      self.sub_category1.items = sup_to_sub[selected_super_category]
    if selected_super_category in category_mapping:
      self.primary_category.items = category_mapping[selected_super_category]
    else:
      self.primary_category.items = []

  def primary_category_change(self, **event_args):
    selected_primary_category = self.primary_category.selected_value
    if selected_primary_category in prim_to_product:
      self.product_name.items = prim_to_product[selected_primary_category]
    if selected_primary_category in first_sub_category_mapping:
      self.sub_category1.items = first_sub_category_mapping[selected_primary_category]    
    else:
      self.sub_category1.items = ['None']

  def sub_category1_change(self, **event_args):
    selected_sub_category1 = self.sub_category1.selected_value
    if selected_sub_category1 in sub1_to_product:
      self.product_name.items = sub1_to_product[selected_sub_category1]
    if selected_sub_category1 in second_sub_category_mapping:
      self.sub_category2.items = second_sub_category_mapping[selected_sub_category1]
    else:
      self.sub_category2.items = ['None']

  def sub_category2_change(self, **event_args):
    selected_sub_category2 = self.sub_category2.selected_value
    if selected_sub_category2 in brand:
      self.brand.items = brand[selected_sub_category2]
    else:
      self.brand.items = ['None']

  def brand_change(self, **event_args):
    selected_brand = self.brand.selected_value
    if selected_brand in product_name:
      self.product_name.items = product_name[selected_brand]
    else:
      self.product_name.items = ['None']

  def Submit_click(self, **event_args):
    product_name = self.product_name.selected_value.strip()
    main_category = self.primary_category.selected_value.strip()
    sub_category1 = self.sub_category1.selected_value.strip()
    sub_category2 = self.sub_category2.selected_value.strip()
    brand = self.brand.selected_value.strip()
    discounted_price = self.discounted_price.text
    super_category = self.super_category.selected_value.strip()
    email = self.email.text
    anvil.server.call('add_ecommerce_info', super_category, main_category, sub_category1, sub_category2, brand, product_name, discounted_price, email)
    answer = anvil.server.call('predict', super_category, main_category, sub_category1, sub_category2, brand, product_name, discounted_price)
    
    if answer:
      self.result.visible = True
      self.result.text = answer
      self.disclaimer.visible = True







    
